import React, { useState } from 'react'

const Collapse = () => {
  const [open, setOpen] = useState(false)
  return (
    <DropDownContainer>
      <DropDownClosed>
        <DropDownTitle>title</DropDownTitle>

        {open && <DropDownArrow></DropDownArrow>}
      </DropDownClosed>
      <DropDownText>text</DropDownText>
    </DropDownContainer>
  )
}

export default Collapse
